  private static final String languagesValues = "japo\u0144ski\u00A6angielski\u00A6turecki\u00A6korea\u0144ski\u00A6norweski\u00A6grecki\u00A6holenderski\u00A6bu\u0142garski\u00A6\u0142otewski\u00A6hebrajski\u00A6czeski\u00A6w\u0142oski\u00A6litewski\u00A6francuski\u00A6chi\u0144ski\u00A6rosyjski\u00A6rumu\u0144ski\u00A6fi\u0144ski\u00A6arabski\u00A6szwedzki\u00A6portugalski\u00A6polski\u00A6s\u0142owe\u0144ski\u00A6s\u0142owacki\u00A6niemiecki\u00A6w\u0119gierski\u00A6esto\u0144ski\u00A6hiszpa\u0144ski\u00A6chorwacki\u00A6du\u0144ski";

  private static final Hashtable languages;
  static
  {
    languages = new Hashtable();
    Enumeration keys = new StringTokenizer(languagesKeys, "\u00A6");
    Enumeration values = new StringTokenizer(languagesValues, "\u00A6");
    while (keys.hasMoreElements())
      {
         String key = (String) keys.nextElement();
         String value = (String) values.nextElement();
         languages.put(key, value);
      }
  }

